// GatewayServiceHandler is an implementation of the logistics.gateway.v1.GatewayService service.
type GatewayServiceHandler interface {
	// ==================== Health & Service Info ====================
	Health(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.HealthResponse], error)
	ReadinessCheck(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.ReadinessResponse], error)
	Info(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.InfoResponse], error)
	GetAlgorithms(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.AlgorithmsResponse], error)
	// ==================== Authentication ====================
	Register(context.Context, *connect.Request[v1.RegisterRequest]) (*connect.Response[v1.AuthResponse], error)
	Login(context.Context, *connect.Request[v1.LoginRequest]) (*connect.Response[v1.AuthResponse], error)
	RefreshToken(context.Context, *connect.Request[v1.RefreshTokenRequest]) (*connect.Response[v1.AuthResponse], error)
	Logout(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[emptypb.Empty], error)
	GetProfile(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.UserProfile], error)
	ValidateToken(context.Context, *connect.Request[v1.ValidateTokenRequest]) (*connect.Response[v1.ValidateTokenResponse], error)
	// ==================== Graph Optimization ====================
	CalculateLogistics(context.Context, *connect.Request[v1.CalculateLogisticsRequest]) (*connect.Response[v1.CalculateLogisticsResponse], error)
	SolveGraph(context.Context, *connect.Request[v1.SolveGraphRequest]) (*connect.Response[v1.SolveGraphResponse], error)
	SolveGraphStream(context.Context, *connect.Request[v1.SolveGraphRequest], *connect.ServerStream[v1.SolveProgressEvent]) error
	BatchSolve(context.Context, *connect.Request[v1.BatchSolveRequest]) (*connect.Response[v1.BatchSolveResponse], error)
	// ==================== Validation ====================
	ValidateGraph(context.Context, *connect.Request[v1.ValidateGraphRequest]) (*connect.Response[v1.ValidateGraphResponse], error)
	ValidateForAlgorithm(context.Context, *connect.Request[v1.ValidateForAlgorithmRequest]) (*connect.Response[v1.ValidateForAlgorithmResponse], error)
	// ==================== Analytics ====================
	AnalyzeGraph(context.Context, *connect.Request[v1.AnalyzeGraphRequest]) (*connect.Response[v1.AnalyzeGraphResponse], error)
	CalculateCost(context.Context, *connect.Request[v1.CalculateCostRequest]) (*connect.Response[v1.CalculateCostResponse], error)
	GetBottlenecks(context.Context, *connect.Request[v1.BottlenecksRequest]) (*connect.Response[v1.BottlenecksResponse], error)
	CompareScenarios(context.Context, *connect.Request[v1.CompareScenariosRequest]) (*connect.Response[v1.CompareScenariosResponse], error)
	// ==================== Simulation ====================
	RunWhatIf(context.Context, *connect.Request[v1.WhatIfRequest]) (*connect.Response[v1.WhatIfResponse], error)
	RunMonteCarlo(context.Context, *connect.Request[v1.MonteCarloRequest]) (*connect.Response[v1.MonteCarloResponse], error)
	RunMonteCarloStream(context.Context, *connect.Request[v1.MonteCarloRequest], *connect.ServerStream[v1.MonteCarloProgressEvent]) error
	AnalyzeSensitivity(context.Context, *connect.Request[v1.SensitivityRequest]) (*connect.Response[v1.SensitivityResponse], error)
	AnalyzeResilience(context.Context, *connect.Request[v1.ResilienceRequest]) (*connect.Response[v1.ResilienceResponse], error)
	SimulateFailures(context.Context, *connect.Request[v1.FailureSimulationRequest]) (*connect.Response[v1.FailureSimulationResponse], error)
	FindCriticalElements(context.Context, *connect.Request[v1.CriticalElementsRequest]) (*connect.Response[v1.CriticalElementsResponse], error)
	GetSimulation(context.Context, *connect.Request[v1.GetSimulationRequest]) (*connect.Response[v1.SimulationRecord], error)
	ListSimulations(context.Context, *connect.Request[v1.ListSimulationsRequest]) (*connect.Response[v1.ListSimulationsResponse], error)
	DeleteSimulation(context.Context, *connect.Request[v1.DeleteSimulationRequest]) (*connect.Response[emptypb.Empty], error)
	// ==================== History ====================
	SaveCalculation(context.Context, *connect.Request[v1.SaveCalculationRequest]) (*connect.Response[v1.SaveCalculationResponse], error)
	GetCalculation(context.Context, *connect.Request[v1.GetCalculationRequest]) (*connect.Response[v1.CalculationRecord], error)
	ListCalculations(context.Context, *connect.Request[v1.ListCalculationsRequest]) (*connect.Response[v1.ListCalculationsResponse], error)
	DeleteCalculation(context.Context, *connect.Request[v1.DeleteCalculationRequest]) (*connect.Response[emptypb.Empty], error)
	GetStatistics(context.Context, *connect.Request[v1.GetStatisticsRequest]) (*connect.Response[v1.StatisticsResponse], error)
	// ==================== Reports ====================
	GenerateReport(context.Context, *connect.Request[v1.GenerateReportRequest]) (*connect.Response[v1.GenerateReportResponse], error)
	GetReport(context.Context, *connect.Request[v1.GetReportRequest]) (*connect.Response[v1.ReportRecord], error)
	DownloadReport(context.Context, *connect.Request[v1.DownloadReportRequest], *connect.ServerStream[v1.ReportChunk]) error
	ListReports(context.Context, *connect.Request[v1.ListReportsRequest]) (*connect.Response[v1.ListReportsResponse], error)
	DeleteReport(context.Context, *connect.Request[v1.DeleteReportRequest]) (*connect.Response[emptypb.Empty], error)
	GetReportFormats(context.Context, *connect.Request[emptypb.Empty]) (*connect.Response[v1.ReportFormatsResponse], error)
	// ==================== Audit (Admin only) ====================
	GetAuditLogs(context.Context, *connect.Request[v1.GetAuditLogsRequest]) (*connect.Response[v1.AuditLogsResponse], error)
	GetUserActivity(context.Context, *connect.Request[v1.GetUserActivityRequest]) (*connect.Response[v1.UserActivityResponse], error)
	GetAuditStats(context.Context, *connect.Request[v1.GetAuditStatsRequest]) (*connect.Response[v1.AuditStatsResponse], error)
}

